心地よい洗面空間を創り出すINAXの水栓金具。美しいデザインと充実の機能はパウダールームを快適にします。<br />●毎朝使う洗面空間は、その日を気持ちよくスタートさせる大切な空間です。<br />●それだけに清潔感や使い勝手の良さ、さらにはデザインの豊かさが求められます。<br />●INAXの水栓金具は高いデザイン性にこだわりつつ、操作性や清掃性などの快適機能に加え、節湯性能にも配慮。<br />●さまざまな暮らしに合った水栓金具を取りそろえています<br />●立水栓<br />●排水栓なし<br />●一般地・寒冷地共用<br />●手のひねりが少なくても吐水・止水ができる90°開閉ハンドルです。<br />●JIS認証品<br />●締付工具はKG-1またはKG-2を使用<br />1回のご購入合計金額(税込)が【5,400円以上】の場合は送料無料です。<br />一部商品（重量物や長尺物など）や、離島および一部遠隔地へのお届けには、別途送料がかかる<br />場合があります。<br />1回のご購入合計金額(税込)が【5,400円未満】の場合は送料がかかります。<br />送料は全国一律540円(重量10kgまで)、沖縄県は10kgまで1,620円を申し受けます。<br />一部商品（重量物や長尺物など）や、離島および一部遠隔地へのお届けには、別途送料がかかる<br />場合があります。●メーカー:LIXIL(INAX)<br />●型式:LF-E01<br />●呼び径:13mm<br />●吐水口長さ:105mm<br /><br />●出荷目安:5営業日以内<br><br>


